// Import package
import React, { Component } from "react";
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

// import NewProducts from "../Component/Home/NewProducts";
// import CityPlaylist from "./CityPlaylist";
// import MoodPlaylist from "./MoodPlaylist";
// import Judul from "../Component/Judul";

// import "../css/App.css";

import { Link } from 'react-router-dom';


class Home extends Component {
    // componentDidMount = () => {
    //     const datao = this.props.GetCuaca().then(
    //         () => {
    //             // console.log("Cuacas", this.props.Cuaca);
    //         }
    //     );
    // };
    render() {
        const { listMovie } = this.props;
        return (
            <div className="App">
                <div className="container-fluid">
                        <section>
                            <div id="carouselExampleIndicators" class="carousel slide w-100" data-ride="carousel">
                                <div class="carousel-inner">
                                    <div class="carousel-item active">
                                        <img src={require("../assets/images/car-1.jpg")} class="d-block w-100" />
                                        <div class="carousel-caption text-dark d-md-block pb-3">
                                            <img src="assets/images/retrovert/retrovert-red.png" width="50%" alt="" />
                                            <h2><strong>Retrovert</strong></h2>
                                        </div>
                                    </div>
                                    <div class="carousel-item">
                                        <img src={require("../assets/images/car-2.jpg")} class="d-block w-100" />
                                        <div class="carousel-caption text-dark d-md-block pb-3">
                                            <img src="assets/images/retrovert/retrovert-white.png" width="50%" alt="" />
                                        </div>
                                    </div>
                                    <div class="carousel-item">
                                        <img src={require("../assets/images/car-3.jpg")} class="d-block w-100" />
                                        <div class="carousel-caption text-dark d-md-block pb-3">
                                            <img src="assets/images/retrovert/retrovert-pink.png" width="50%" alt="" />
                                        </div>
                                    </div>
                                    <div class="carousel-item">
                                        <img src={require("../assets/images/car-4.jpg")} class="d-block w-100" />
                                        <div class="carousel-caption text-dark d-md-block pb-3">
                                            <img src="assets/images/retrovert/retrovert-blue.png" width="50%" alt="" />
                                        </div>
                                    </div>
                                </div>
                                <a class="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
                                </a>
                                <a class="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
                                </a>
                            </div>
                        </section>

                </div>
                {/* <NewProducts /> */}
            </div>
        );
    }
}
// export default withRouter(Home);

// export default connect(
//     'listSong', actions
// )(withRouter(Home));
export default withRouter(Home)
